<!-- Start Contact -->
<section id="mu-contact" style="background-color: #fbfbfb">






    <div class="container">

        <div class="row">
            <div class="col-md-12">
                <div class="mu-contact-area" style="padding-top: 60px">


                    <div class="mu-title-area" id="card-step-1">
                        <div class="col-md-12">
                            <div class="mu-contact-left">
                                <div class="mu-contact-form">
                                    <div class="form-group">
                                        <textarea type="text"  placeholder="通过淘口令(含有https://m.tb.cn)或真实链接(如https://detail.tmall.com/item.htm?id=604906722403)查询" id="link" class="form-control" style="text-align: left;font-size: 12px;"></textarea>
                                        <button  class="mu-send-msg-btn" style="font-size: 16px;padding: 10px;" id="query-button"><span>查询</span></button>
                                    </div>

                                </div>


                            </div>
                        </div>
                    </div>


                    <div class="mu-title-area" id="card-step-2">
                        <div class="col-md-12" style="padding-left: 20px;padding-right: 20px;display: flex;justify-content: center;align-items: start;text-align: left;height: 120px">
                            <div class='pic' style="width: 35%"><img id="itemPic" ></div>
                            <div style="padding-left: 20px;width: 65%;padding-top: 5px">
                                <div style="font-size: 12px;font-weight: bold;height: 40px;overflow: hidden;" id="itemTitle"></div>
                                <div style="font-size: 10px;margin-top: 4px;color: darkred;height: 80px;overflow: hidden;" id="itemStyle"></div>
                            </div>
                        </div>


                        <div id="configPad" >
                            <div id="itemStylePad" class="col-md-12" style="margin-top:10px;padding-left: 20px;padding-right: 20px;display: flex;  flex-wrap: wrap;justify-content: space-between;align-items: start;text-align: left;height: 180px"></div>

                            <div  class="col-md-12" style="margin-top:20px;padding-left: 20px;padding-right: 20px;display: flex;  flex-wrap: wrap;justify-content: space-between;align-items: start;text-align: left;height: 180px">
                                <div class='itemLong' >
                                    <div class='itemTitle' >自动跳转时间</div>
                                    <input class="itemSelect" type="datetime-local" id="timeInput">
                                </div>
                                <div class='itemLong' id="basemode-time-offset">
                                    <div class='itemTitle' >时间偏移</div>
                                    <select class='itemSelect' id="time-offset-select">
                                        <option value=0 >不偏移</option>
                                        <option value=50 >提前50ms</option>
                                        <option value=100 >提前100ms</option>
                                        <option value=150 >提前150ms</option>
                                        <option value=200 >提前200ms</option>
                                        <option value=250 >提前250ms</option>
                                        <option value=300 >提前300ms</option>
                                        <option value=400 >提前400ms</option>
                                    </select>
                                </div>
                                <div class='itemLong' id="promode-time-offset">
                                    <div class='itemTitle' >时间偏移(输入提前的时间,单位ms,延后则为负数)</div>
                                    <input class="itemSelect" value="0"  id="time-offset-input" style='text-indent: 4px'>
                                </div>
                                <div class='itemLong' id="promode-channel-select">
                                    <div class='itemTitle' >频道选择（通用/百亿补贴）</div>
                                    <select class='itemSelect' id="channel-select">
                                        <option value='defalut' selected>【通用频道】</option>
                                        <option value='bybtqdyh' >【百亿补贴】</option>
                                        <option value='tips' >（若不清楚请选通用频道）</option>
                                    </select>
                                </div>
                            </div>
                            <button  class="mu-primary-btn" style="color: gray; font-size: 14px;padding: 10px;width: 40%;text-align: center;border-color: lightgray" id="promode-time-button"><span>测试淘宝延迟</span></button>
                            <button  class="mu-primary-btn"  style="color: gray; font-size: 14px;padding: 10px;width: 40%;text-align: center;border-color: lightgray" id="promode-copy-button"><span>复制BP链接</span></button>
                            <button  class="mu-send-msg-btn" style="font-size: 16px;padding: 10px;" id="config-button"><span>下一步</span></button>
                        </div>
                        <div id="readyPad" >
                            <div  class="col-md-12" style="margin-top:20px;padding-left: 20px;padding-right: 20px;display: flex;  flex-wrap: wrap;justify-content: space-between;align-items: start;text-align: left;height: 120px">
                                <div class='itemLong' >
                                    <div class='itemTitle' id="time-confirm"></div>
                                    <div class='itemDiv' id="time-count"></div>
                                </div>

                            </div>
                            <button  class="mu-primary-btn" style="color: gray; font-size: 14px;padding: 10px;width: 30%;text-align: center;border-color: lightgray" id="buy-button"><span>测试跳转</span></button>


                        </div>



                    </div>

                </div>
            </div>
        </div>

        <div class="row" style="font-size: 12px;color: #888888;padding: 30px;margin-top: 0px" id="tips-content">

            <p >
                ⚠️⚠️️注意️⚠️⚠️️

                <br>(2)点击右上角的【专业模式】，可提供复制BP链接、精准时间偏移设置、延迟测试、百亿补贴频道支持等功能
                <br>(3)0点发售的跳转时间请选择该天的【上午12点】或将手机设置为【24小时制】后选择0点，具体参见<a style="font-weight: bold" href="https://docs.qq.com/doc/DYlpobEdheENTWUNt?disableReturnList=1&_from=1#nativewebviewwww.nike.com">使用指南</a>
            </p>



        </div>

        <div class="topBar" >
            <div class="topBarButton-Large" id="professional-button" >专业模式</div>
            <div class="topBarLine" ></div>
            <div class="topBarButton-Small" id="reset-button" >✕</div>

        </div>

    </div>






</section>

        return safe_add(bit_rol(safe_add(safe_add(a, q), safe_add(x, t)), s),b);
    }
    function md5_ff(a, b, c, d, x, s, t)
    {
        return md5_cmn((b & c) | ((~b) & d), a, b, x, s, t);
    }
    function md5_gg(a, b, c, d, x, s, t)
    {
        return md5_cmn((b & d) | (c & (~d)), a, b, x, s, t);
    }
    function md5_hh(a, b, c, d, x, s, t)
    {
        return md5_cmn(b ^ c ^ d, a, b, x, s, t);
    }
    function md5_ii(a, b, c, d, x, s, t)
    {
        return md5_cmn(c ^ (b | (~d)), a, b, x, s, t);
    }

    /*
     * Calculate the HMAC-MD5, of a key and some data
     */
    function core_hmac_md5(key, data)
    {
        var bkey = str2binl(key);
        if(bkey.length > 16) bkey = core_md5(bkey, key.length * chrsz);

        var ipad = Array(16), opad = Array(16);
        for(var i = 0; i < 16; i++)
        {
            ipad[i] = bkey[i] ^ 0x36363636;
            opad[i] = bkey[i] ^ 0x5C5C5C5C;
        }

        var hash = core_md5(ipad.concat(str2binl(data)), 512 + data.length * chrsz);
        return core_md5(opad.concat(hash), 512 + 128);
    }

    /*
     * Add integers, wrapping at 2^32. This uses 16-bit operations internally
     * to work around bugs in some JS interpreters.
     */
    function safe_add(x, y)
    {
        var lsw = (x & 0xFFFF) + (y & 0xFFFF);
        var msw = (x >> 16) + (y >> 16) + (lsw >> 16);
        return (msw << 16) | (lsw & 0xFFFF);
    }

    /*
     * Bitwise rotate a 32-bit number to the left.
     */
    function bit_rol(num, cnt)
    {
        return (num << cnt) | (num >>> (32 - cnt));
    }

    /*
     * Convert a string to an array of little-endian words
     * If chrsz is ASCII, characters >255 have their hi-byte silently ignored.
     */
    function str2binl(str)
    {
        var bin = Array();
        var mask = (1 << chrsz) - 1;
        for(var i = 0; i < str.length * chrsz; i += chrsz)
            bin[i>>5] |= (str.charCodeAt(i / chrsz) & mask) << (i%32);
        return bin;
    }

    /*
     * Convert an array of little-endian words to a string
     */
    function binl2str(bin)
    {
        var str = "";
        var mask = (1 << chrsz) - 1;
        for(var i = 0; i < bin.length * 32; i += chrsz)
            str += String.fromCharCode((bin[i>>5] >>> (i % 32)) & mask);
        return str;
    }

    /*
     * Convert an array of little-endian words to a hex string.
     */
    function binl2hex(binarray)
    {
        var hex_tab = hexcase ? "0123456789ABCDEF" : "0123456789abcdef";
        var str = "";
        for(var i = 0; i < binarray.length * 4; i++)
        {
            str += hex_tab.charAt((binarray[i>>2] >> ((i%4)*8+4)) & 0xF) +
                hex_tab.charAt((binarray[i>>2] >> ((i%4)*8  )) & 0xF);
        }
        return str;
    }

    /*
     * Convert an array of little-endian words to a base-64 string
     */
    function binl2b64(binarray)
    {
        var tab = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/";
        var str = "";
        for(var i = 0; i < binarray.length * 4; i += 3)
        {
            var triplet = (((binarray[i   >> 2] >> 8 * ( i   %4)) & 0xFF) << 16)
                | (((binarray[i+1 >> 2] >> 8 * ((i+1)%4)) & 0xFF) << 8 )
                |  ((binarray[i+2 >> 2] >> 8 * ((i+2)%4)) & 0xFF);
            for(var j = 0; j < 4; j++)
            {
                if(i * 8 + j * 6 > binarray.length * 32) str += b64pad;
                else str += tab.charAt((triplet >> 6*(3-j)) & 0x3F);
            }
        }
        return str;
    }
